INSERT INTO `charts` (`CHART_ID`, `TYPE`, `RELATED_CHARTS`, `INDICATOR_ID`, `CHART_SHORT_TITLE`, `CHART_LONG_TITLE`, `CARROUSEL_TITLE`, `RELATED_MESSAGE`) VALUES
	(1, 'SIMPLE', NULL, 1, NULL, NULL, NULL, NULL),
	(2, 'SIMPLE', NULL, 2, NULL, NULL, NULL, NULL),
	(3, 'COMPOSED', '1, 2', NULL, 'Cost to society of work-related injury and illness', 'Cost to society of work-related injury and illness', NULL, 'Work-related injuries and illnesses result in the loss of 4.3% of all work-years globally and 3.2% of those in the EU, equivalent to a cost of  approximately 3,092 billion and 504 billion, respectively.'),
	(4, 'SIMPLE', NULL, 3, NULL, NULL, NULL, NULL),
	(5, 'SIMPLE', NULL, 4, NULL, NULL, NULL, NULL),
	(6, 'COMPOSED', '4,5', NULL, 'Mortality: deaths resulting from work-related injury and illness (number of fatalities)', 'Mortality: deaths resulting from work-related injury and illness (number of fatalities)', NULL, 'Work-related illnesses account for 85% of all deaths related to work globally and 98% in the EU. '),
	(7, 'SIMPLE', NULL, 5, NULL, NULL, NULL, NULL),
	(8, 'SIMPLE', NULL, 6, NULL, NULL, NULL, NULL),
	(9, 'COMPOSED', '7,8', NULL, 'DALY (disability-adjusted life years) lost due to work-related injury and illness (millions of years)', 'DALY (disability-adjusted life years) lost due to work-related injury and illness (millions of years)', NULL, 'In total, 134.2 million DALY are lost globally as a result of work-related injury and illness and 7 million in the EU. 56.2 million of these are years of life lost due to fatal injury or illness (3.4 million in the EU) and 78 million are lived with disabi'),
	(10, 'SIMPLE', NULL, 7, 'Percentage of all work-related deaths due to different illnesses or injury', 'Percentage of all work-related deaths due to different illnesses or injury', NULL, NULL),
	(11, 'SIMPLE', NULL, 8, 'Percentage of all work-related deaths due to different illnesses or injury', 'Percentage of all work-related deaths due to different illnesses or injury', NULL, NULL),
	(12, 'COMPOSED', '10,11', NULL, 'What are the main work-related illnesses and injuries resulting in death and disability?', 'What are the main work-related illnesses and injuries resulting in death and disability?', NULL, NULL),
	(13, 'SIMPLE', NULL, 9, 'Percentage of all work-related DALY due to different illnesses or injury', 'Percentage of all work-related DALY due to different illnesses or injury', NULL, NULL),
	(14, 'SIMPLE', NULL, 10, 'Percentage of all work-related DALY due to different illnesses or injury', 'Percentage of all work-related DALY due to different illnesses or injury', NULL, NULL),
	(15, 'COMPOSED', '13,14', NULL, 'What are the main work-related illnesses and injuries resulting in DALY?', 'What are the main work-related illnesses and injuries resulting in DALY?', NULL, 'Circulatory injuries are the biggest killer with xxxxx fatal cases per year in the world, followed by the cancer with xxxx cases. However, xxxxx lead to a higher number of years of life lost or years lived with disability (due to non-fatal cases). In the '),
	(16, 'SIMPLE', NULL, 11, 'Mortality: deaths per 100,000 workers', 'Mortality: deaths per 100,000 workers', 'Mortality', 'The mortality rate (deaths resulting from work-related injury and illness per 100,000 workers) ranges from 46 cases in AMRO to 100 cases in EURO per 100,000 workers (92 in the EU28). 80%-98% are due to work-related illness.\n'),
	(17, 'SIMPLE', NULL, 12, 'Years of Life Lost (YLL) resulting from fatal cases per 100.000 workers ', 'Years of Life Lost (YLL) resulting from fatal cases per 100.000 workers ', 'Years of life lost', 'The rate of years of Life Lost (YLL per 100,000 workers) due to work-related injury and illness ranges from 1,075 years in AMRO to 2,338 years in EURO per 100.000 workers (1,541 in the EU28).'),
	(18, 'SIMPLE', NULL, 13, 'Total years lost: Comparison of Years of Life Lost (YLL) and Years Lived with Disability (YLD) ', 'Total years lost: Comparison of Years of Life Lost (YLL) and Years Lived with Disability (YLD) ', 'Years of Life Lost vs Years Lived with Disability', 'In all regions except WPRO, more years are lived with disability (YLD) than are lost due to early death (YLL). In the EU28, YLD accounts for 51% and YLL for 49%.'),
	(19, 'SIMPLE', NULL, 14, NULL, NULL, NULL, NULL),
	(20, 'SIMPLE', NULL, 15, NULL, NULL, NULL, NULL),
	(21, 'COMPOSED', '19,20', NULL, 'Cost to society in terms of DALY rate (years per 100,000 workers) and in terms of proportion of all work-years lost expressed as percentage equivalent of total GDP (%)', 'Cost to society in terms of DALY rate (years per 100,000 workers) and in terms of proportion of all work-years lost expressed as percentage equivalent of total GDP (%)', 'Total cost', 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) varies from 2,891 years in HIGH to 8'),
	(22, 'SIMPLE', NULL, 16, 'Years of Life Lost (YLL) per 100,000 workers', 'Years of Life Lost (YLL) per 100,000 workers', 'Years of life lost', 'The rate of years of Life Lost (YLL per 100,000 workers) due to work-related injury and illness ranges from from 940 years in Malta to 2,616 years in Bulgaria per 100.000 workers (1,541 in the EU28).'),
	(23, 'SIMPLE', NULL, 17, 'Years lived with disability (YLD) per 100,000 workers', 'Years lived with disability (YLD) per 100,000 workers', 'Years lived with disability', 'The rate of years of Lived with Disability (YLD per 100,000 workers) due to work-related injury and illness ranges from from 450 years in Malta to 6,401 years in Bulgaria per 100.000 workers (1,617 in the EU28).'),
	(24, 'SIMPLE', NULL, 18, 'Total years lost: Disability adjusted life years (DALY) per 100,000 workers', 'Total years lost: Disability adjusted life years (DALY) per 100,000 workers', 'Total years lost', 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) varies from 1,390 years in Malta to '),
	(25, 'SIMPLE', NULL, 19, 'Cost expressed as proportion of all work-years lost expressed as percentage equivalent of total GDP (%)', 'Cost expressed as proportion of all work-years lost expressed as percentage equivalent of total GDP (%)', 'Total GDP workyears lost', 'The total cost can be expressed as DALY rate or as proportion of all work-years lost expressed as percentage equivalent of total GDP (%). In this sense, the workyears loss ranges from 1.39% in Malta to 7.89% in Portugal (3.20% in the EU28)'),
	(26, 'SIMPLE', NULL, 20, 'Work-related injury contribution to total GDP work-years lost', 'Work-related injury contribution to total GDP work-years lost', 'From work-related illnesses', 'Work-related injuries contribution to the workyears loss ranges from 0.01% in Belgium to 1.28% in Malta (0.37% in the EU28).\n'),
	(27, 'SIMPLE', NULL, 21, 'Work-related illness contribution to total GDP work-years lost (%)', 'Work-related illness contribution to total GDP work-years lost (%)', 'From work-related injuries', 'Work-related illnesses contribution to workyears loss ranges from 0.11% in Malta to 7.15% in Portugal (2.83% in the EU28).'),
	(28, 'SIMPLE', NULL, 22, 'Mortality distributed by the main work-related illnesses groups and work-related injuries', 'Mortality distributed by the main work-related illnesses groups and work-related injuries', 'Mortality distributed by illnesses', NULL),
	(29, 'SIMPLE', NULL, 23, 'Total years of life lost and lived with disability (DALY) distributed by the main work-related illnessess groups and work-related injuries', 'Total years of life lost and lived with disability (DALY) distributed by the main work-related illnessess groups and work-related injuries', 'Total years lost distributed by illnesses', NULL),
	(30, 'SIMPLE', NULL, 24, 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Years of Life Lost and Years Lived with Disability by illnesses', NULL),
	(31, 'SIMPLE', NULL, 25, 'DALY', 'DALY', NULL, NULL),
	(32, 'SIMPLE', NULL, 26, 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'All work-related illnesses and injuries', 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) varies from 1,390 years in Malta to '),
	(33, 'SIMPLE', NULL, 26, 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Cancer', 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) resulting from Cancer varies from 64'),
	(34, 'SIMPLE', NULL, 26, 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'MSD', 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) resulting from MSD varies from 60 ye'),
	(35, 'SIMPLE', NULL, 26, 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Circulatory', 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) resulting from Circulatory diseases '),
	(36, 'SIMPLE', NULL, 27, 'Comparison of years of life lost (YLL) by illness group and gender, age group or sector', 'Comparison of years of life lost (YLL) by illness group and gender, age group or sector', NULL, 'Lorem ipsum Lorem ipsum Lorem ipsum');
