	(9, 'In all the world regions except WPRO, the cost of non-fatal work-related injury and illness is higher than the fatal ones. Consequently, the number of Years of Lived with Disability (YLD) is higher than the Years of Life Lost (YLL).', b'0', b'0', b'1', b'0', b'0', b'0', b'0', b'0'),
	(10, '3.2% of the GDP work-years are due to work-related injury and illness. The majority is due to work-related diseases reaching the 2,8% of the GDP workyears.', b'0', b'0', b'0', b'1', b'0', b'0', b'0', b'0'),
	(11, 'Lorem ipsum lorem ipsum lorem ipsum lorem ipsum Lorem ipsum lorem ipsum lorem ipsum lorem ipsum Lorem ipsum lorem ipsum lorem ipsum lorem ipsum', b'0', b'0', b'0', b'0', b'1', b'0', b'0', b'0'),
